import React, { useEffect, useState } from 'react'
import './UserList.css'
import axios from 'axios';
import Select from 'react-select';
import { Button } from '@material-ui/core';
import authHeader from '../../../services/authHeader';
import Sidebar from '../sidebar/Sidebar';
import Topbar from '../topbar/Topbar';
import { DataGrid } from '@material-ui/data-grid';

export default function UserList() {
  const config = {
    headers: authHeader() 
  };

  const [jdata, setJData] = useState([]);
  const loadOwner = async () => {
    axios.get("http://localhost:9000/api/owner",config)
    .then((res) => {
      console.log("owner"+res.data)
      setJData(res.data);
    })
    .catch(err => {
      console.log(err)
    })
    
  };
  useEffect(() => {
   loadOwner();
  }, [])


  const handleClick=(e)=>{
    const value={
      "owner":{id:e.target.id}
    }
    console.log(value);
    axios.post("http://localhost:9000/api/ride/add",value,config).then(res=>{
     alert("ride booked");
      loadOwner();
  }
  ).catch((err)=>{
         console.log("There are Errors in the Entry")
     }) 
  }
  

 
  const [sdata, setSData] = useState([]);
  const [place, setPlace] = useState([]);

  const columns = [
    { field: 'id', headerName: 'ID', width: 170 },
    { field: 'name', headerName: 'NAME', width: 170 },
    { field: 'age', headerName: 'AGE', width: 170 },
  ];
    
  const rows = [
    { id: 1, name: 'Gourav', age: 12 },
    { id: 2, name: 'Geek', age: 43 },
    { id: 3, name: 'Pranav', age: 41 },
  ];
  

  console.log(sdata);
  console.log(place);
  return (
    <div>
      <Topbar/>
      <div className="container">
        <Sidebar/>
     
     
     
       
        
       
     
        <div>
        <DataGrid
        rows={rows}
        columns={columns}
        pageSize={5}
        rowsPerPageOptions={[5]}
        checkboxSelection
        disableSelectionOnClick
      />
      </div>
    </div>
    </div>
  )
}
